import React, { Component } from 'react';
import Dashboard from '../components/Dashboard';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch
} from 'react-router-dom';

const routes = [
  {
    path:'/dashboard',
    exact:true,
    sidebar: () => <span>Home</span>,
    main: Dashboard
  },
  {
    path:'/dashboard/a',
    exact:true,
    sidebar: () => <span>Home</span>,
    main: () => <h1>A</h1>
  },
  {
    path:'/dashboard',
    exact:true,
    sidebar: () => <span>Home</span>,
    main: () => <h1>A</h1>
  },
]

const Routes = (props) => {
  return (
    <Router>
      <div className='col-8'>
        <ul>
          <li>
            <Link to='/dashboard'>
              Home
            </Link>
          </li>
          <li>
            <Link to='/dashboard/a'>
              A
            </Link>
          </li>
          <li>
            <Link to='/dashboard/b'>
              B
            </Link>
          </li>
        </ul>
      </div>

      <div className='col-8'>
        <Switch>
          {routes.map((route, index) => {
            <Routes key={index} path={route.path} exact={route.exact} children={route.main}/>
          })}
        </Switch>
      </div>
    </Router>
  )
}

export default Routes;
